■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>絨毯の上を歩くような履き心地。アーチサポートで足裏快適!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="610" valign="top" align="center"><div><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple5161/7204bm-01.jpg" width="600" height="709"><br><font size=3></font></div><br><table width="600" border="0" align="center" cellpadding="5" cellspacing="1" bgcolor="#999999"><tr><td bgcolor="#FFFFCC"><table width="100%" border="0" cellpadding="3" cellspacing="0"><tr><th><font color="#FF0000">------&nbsp;ココがポイント！&nbsp;------</font></th></tr><tr><td><strong><font size="3" color="#FF9900">●ゆび先まで快適フルサイズ!!</font></strong></td></tr></table></td></tr></table><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><font size="3">【商品ポイント】<br>(1)足の快適さをサポートします。<br>足骨格のアーチ構造を正しくサポートする「アーチパッド」を3ヶ所に配置し、足の快適さをサポートします。<br>(2)歩行時の足への衝撃を緩和させます<br>2種類の硬さの異なるウレタンフォームを組み合わせることにより、歩行時の足への衝撃をやわらげます。<br>(3)足の前すべり防止<br>中敷き素材に滑り止め加工を施し、歩行時の足の前すべりを防止します。<br>(4)ゆび先も快適<br>ゆび先までスポンジがあるため、ゆび先まで快適です。<br>(5)抗菌防臭<br>中敷き素材に抗菌防臭加工を施しています。<br><br>【お使いになれる靴】<br>低および中ヒールのパンプス・ブーツで、ゆび先にある程度余裕のある靴にお使いください。<br>※靴用の中敷きとしてお使いください。<br><br>※使用方法と注意※<br>■必要に応じてハサミ等で大きさを調整してください。<br>■着脱可能なカップインソール等が入っている場合は、取り外してから本品を入れてお使いください。<br>■本品の凹凸形状が足になじむまで2週間程度かかる場合があります。ただしこの期間内であっても、足や体に異常を感じた場合は使用をおやめください。<br>■本品は治療用ではありません。血行障害のある方、糖尿病の方、足裏に傷・湿疹・はれもの等のある方は医師に相談の上、ご使用ください。<br>※本品表面の色合いにバラツキが出ることがあります。<br>※本品の仕様・外観・パッケージは予告なく変更することがあります。</font></td></tr></table><br><br><table width="600" cellspacing="0" cellpadding="0" border="0" align="center"></table></td></tr></table><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"><tr><td width="600" valign="top" align="left"><br><font size="3">人気のヘブンリーインソールがリニューアル!絨毯の上を歩いているような履き心地で、足の快適さをサポートします。(特許取得済)</font></td></tr></table><br><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">人気のヘブンリーインソールがリニューアル!絨毯の上を歩いているような履き心地で、足の快適さをサポートします。(特許取得済)</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">女性用/S:22.0～22.5cm、M:23.0～23.5cm、L:24.0～24.5cm</font><br><font color="#333333" size="-1">個装サイズ：30×11×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：45g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">合成皮革<br>ウレタンフォーム</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">女性用1足(2枚)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
