■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。 その場合はご連絡させて頂きますので予めご了承ください<table width="600" border="0" align="center" cellpadding="0" cellspacing="0"><tr><td><font color="#009999" size="5"><strong>プロ技術から生まれたインソール!</strong></font></td></tr></table><br><table width="610" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="610" valign="top" align="center"><div ><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0324/4074am-01.jpg" width="600" height="600"><br><font size=3>※この写真はMサイズです。</font></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><font size="3">【Insole PROシリーズは】<br>自分の体重を矯正力として利用する足底装具の理論に基づいた、「トラブル別インソール」です。<br>靴に装着するだけで足骨格を正常な状態にサポートし、<br>腰から下の主要な女性8種類、男性7種類のトラブルに対応します。<br><br>【使用方法と注意】<br>●ご自身のトラブルに適合したタイプをお選びください。<br>●必要に応じてハサミ等で大きさを調節してください。<br>●靴の中敷としてお使いください。<br>●着脱可能なカップインソール等が入っている場合は、取り外してから本品を入れてお使いください。<br>●洗濯は洗剤を付けたブラシで丁寧に水洗いし、陰干しにしてください。<br>■足や身体に異常を感じた場合は、ご使用をおやめください。<br>■本品は治療用ではありません。血行障害・糖尿病の方、足裏に傷・湿疹・はれもの等のある方は、医師に相談の上ご使用ください。<br>■表面素材の特性上、若干色落ちすることがあります。<br>※本品を装着した場合の効果には個人差があります。上記の商品特徴も、すべての方に対する効果を保証するものではありません。</font></td></tr></table><br><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0324/4074am-02.jpg" width="600" height="763"><br><font size=3>※この写真は中身です。</font></div><br><div align='center'><img src="http://image.rakuten.co.jp/tuhan-ya/cabinet/t_simple0324/4074am-03.jpg" width="600" height="300"></div><br><table width="600" border="0" align="center" cellpadding="1" cellspacing="0"> <tr> <td width="600" valign="top" align="left"><br><font size="3">インソールプロは、プロの技術から生まれた、足、膝、腰などのお悩みに対応するプロ仕様のインソールです。外反母趾対策は、崩れた横アーチを正常な状態にサポートします。同時に「3つのアーチパッド」で足の基本骨格を守ります。</font></td></tr></table></td></tr></table><!--ab--><!--ab2015.6-->■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">インソールプロは、プロの技術から生まれた、足、膝、腰などのお悩みに対応するプロ仕様のインソールです。外反母趾対策は、崩れた横アーチを正常な状態にサポートします。同時に「3つのアーチパッド」で足の基本骨格を守ります。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td width="75%" align="left"><font color="#333333" size="-1">S(22～22.5cm)、M(23～23.5cm)、L(24～25cm)</font><br><font color="#333333" size="-1">個装サイズ：11×30×2cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：52g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">カラー</font></td><td align="left"><font color="#333333" size="-1">ベージュ</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">素材・材質</font></td><td align="left"><font color="#333333" size="-1">ポリエステル、ウレタンスポンジ</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">レディス<br>抗菌防臭<br>対応シューズ<br>　カジュアルシューズ<br>　ウォーキングシューズ<br>　パンプスローヒール<br>特許取得<br>靴用中敷き</font><br></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">セット内容</font></td><td align="left"><font color="#333333" size="-1">1足入</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--スペックここまで--><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
